import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { BrowserAnimationsModule } from '@angular/platform-browser/animations';
import { MainComponent } from './main/main.component';
import { HomeComponent } from './main/home/home.component';
import { OuterComponent } from './outer/outer.component';
import { LoginComponent } from './outer/login/login.component';
import { RegisterComponent } from './outer/register/register.component';
import { SalusRestApiService } from './service/salus-rest-api.service';

@NgModule({
  declarations: [
    AppComponent,
    MainComponent,
    HomeComponent,
    OuterComponent,
    LoginComponent,
    RegisterComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    BrowserAnimationsModule
  ],
  providers: [SalusRestApiService],
  bootstrap: [AppComponent]
})
export class AppModule { }
